import React from 'react';

function Home() {
  const topics = [
    'React Info', 'JavaScript Info', 'CSS Basics', 'HTML Fundamentals',
    'Node.js', 'TypeScript', 'Git & GitHub', 'Web APIs',
    'Async/Await', 'State Management', 'Hooks', 'Performance',
    'Testing', 'Security', 'Deployment', 'REST APIs',
    'Debugging', 'Best Practices', 'Design Patterns', 'Data Structures',
    'Algorithms', 'Databases'
  ];

  return (
    <div style={{ 
      minHeight: '100vh', 
      background: '#0a0a0a',
      color: '#989494',
      padding: '0'
    }}>
      {/* Hero Section */}
      <div style={{
        display: 'grid',
        margin: '20px',
        borderTop: '1px solid #333',
        borderBottom: '1px solid #333',
        gridTemplateColumns: 'repeat(4, 1fr)',
        gap: '15px',
        padding: '20px',
        height: '60vh',
        justifyItems: 'center',
        alignItems: 'center'
      }}>
        <div style={{
          border: '1px solid #333',
          padding: '30px 50px',
          borderRadius: '5px',
          width: '100%',
          textAlign: 'center',
          background: '#111',
          transition: 'all 0.3s ease'
        }}>
          <h2 style={{ fontSize: '24px', marginBottom: '10px', color: '#fff' }}>LEARN</h2>
          <p>Master the fundamentals</p>
        </div>
        <div style={{
          border: '1px solid #333',
          padding: '30px 50px',
          borderRadius: '5px',
          width: '100%',
          textAlign: 'center',
          background: '#111',
          transition: 'all 0.3s ease'
        }}>
          <h2 style={{ fontSize: '24px', marginBottom: '10px', color: '#fff' }}>BUILD</h2>
          <p>Create projects</p>
        </div>
        <div style={{
          border: '1px solid #333',
          padding: '30px 50px',
          borderRadius: '5px',
          width: '100%',
          textAlign: 'center',
          background: '#111',
          transition: 'all 0.3s ease'
        }}>
          <h2 style={{ fontSize: '24px', marginBottom: '10px', color: '#fff' }}>PRACTICE</h2>
          <p>Sharpen your skills</p>
        </div>
        <div style={{
          border: '1px solid #333',
          padding: '30px 50px',
          borderRadius: '5px',
          width: '100%',
          textAlign: 'center',
          background: '#111',
          transition: 'all 0.3s ease'
        }}>
          <h2 style={{ fontSize: '24px', marginBottom: '10px', color: '#fff' }}>GROW</h2>
          <p>Advance your career</p>
        </div>
      </div>

      {/* Topic Buttons Grid */}
      <div style={{
        display: 'grid',
        margin: '20px',
        border: '1px solid #333',
        gridTemplateColumns: 'repeat(7, 1fr)',
        gap: '15px',
        padding: '20px',
        borderRadius: '5px',
        justifyItems: 'center',
        alignItems: 'center'
      }}>
        {topics.map((topic, index) => (
          <div
            key={index}
            style={{
              border: '1px solid #333',
              padding: '30px 50px',
              color: '#989494',
              borderRadius: '5px',
              cursor: 'pointer',
              textAlign: 'center',
              width: '100%',
              maxWidth: 'fit-content',
              background: '#0a0a0a',
              transition: 'all 0.3s ease'
            }}
            onMouseEnter={(e) => {
              e.currentTarget.style.borderColor = '#666';
              e.currentTarget.style.color = '#fff';
            }}
            onMouseLeave={(e) => {
              e.currentTarget.style.borderColor = '#333';
              e.currentTarget.style.color = '#989494';
            }}
          >
            {topic}
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
